import React from 'react';
import { Box, Container, Typography, Grid, Paper } from '@mui/material';
import './about.css';

const boardMembers = [
  {
    name: 'Jacenta',
    title: 'President',
    introduction: 'Jacenta is the visionary behind Grace of Good Food Ministries...',
    image: process.env.PUBLIC_URL + '/images/five.jpeg',
  },
  {
    name: 'Carol Collett',
    title: 'Vice President',
    introduction: 'Carol Collett brings decades of experience in nonprofit management...',
    image: process.env.PUBLIC_URL + '/images/four.jpeg',
  },
  {
    name: 'Kirk Belmont',
    title: 'Treasurer',
    introduction: 'Kirk Belmont is a seasoned financial expert with a heart for philanthropy...',
    image: process.env.PUBLIC_URL + '/images/three.jpeg',
  },
  {
    name: 'Moses Kayuni',
    title: 'Community Outreach Coordinator',
    introduction: 'Moses Kayuni is a community organizer with a deep understanding...',
    image: process.env.PUBLIC_URL + '/images/two.jpeg',
  },
];

const staffMembers = [
  {
    name: 'Titu & Shupi Chirwa',
    title: 'Program Coordinator',
    introduction: 'Director and Administrator at Grace of God Ministries...',
    image: process.env.PUBLIC_URL + '/images/three.jpeg',
  },
  {
    name: 'Agness',
    title: 'Teacher at Grace of God Ministries',
    introduction: 'Agness has been teaching for four years and is the mom to two young boys...',
    image: process.env.PUBLIC_URL + '/images/three.jpeg',
  },
  {
    name: 'Alinafe',
    title: 'Teacher at Grace of God Ministries',
    introduction: 'Alinafe has been a teacher at Grace of God for three years...',
    image: process.env.PUBLIC_URL + '/images/three.jpeg',
  },
  {
    name: 'Chifundo',
    title: 'Teacher at Grace of God Ministries',
    introduction: 'Teacher at Grace of God Ministries...',
    image: process.env.PUBLIC_URL + '/images/three.jpeg',
  },
];

const volunteers = [
  {
    name: 'Maro Chirwa',
    title: 'Heart for the Nations Board Member',
    introduction: 'Maro is passionate about community outreach...',
    image: process.env.PUBLIC_URL + '/images/one.jpeg',
  },
  {
    name: 'Amy Collett',
    title: 'Educational Coordinator - Grace of God Ministries',
    introduction: 'Amy has spent her last 5 years developing the preschool...',
    image: process.env.PUBLIC_URL + '/images/two.jpeg',
  },
  {
    name: 'Hannah Schwering',
    title: 'Educational Coordinator - Grace of God Ministries',
    introduction: 'Hannah is new to the crew, just arriving in June 2024...',
    image: process.env.PUBLIC_URL + '/images/one.jpeg',
  },
  {
    name: 'Martha Chirwa',
    title: 'Chimvite School Liaison',
    introduction: 'Martha and her late husband, Akim, partnered with our founder...',
    image: process.env.PUBLIC_URL + '/images/one.jpeg',
  },
];

const About = () => {
  return (
    <div className="about-wrapper">
      {/* Introductory Section */}
      <Box className="about-hero-container">
        <Box className="about-intro-container">
          <Typography variant="h2" component="h2" className="intro-title">
            Meet the Team
          </Typography>
          <Typography variant="body1" className="intro-description">
            Our dynamic and diverse team consists of a multinational group of volunteers and paid staff, dedicated to making a positive impact in our community.
          </Typography>
        </Box>
      </Box>

      {/* Board Members Section */}
      <Container>
        <Typography variant="h3" component="h3" className="section-title">
          Board of Trustees
        </Typography>
        <Grid container spacing={6} className="team-grid">
          {boardMembers.map((member, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <Paper className={`team-card ${index % 2 === 0 ? 'align-left' : 'align-right'}`}>
                <Box className="team-image-container">
                  <img src={member.image} alt={member.name} className="team-image" />
                  <Box className="team-overlay">
                    <Typography variant="h5" component="h3" className="team-name">
                      {member.name}
                    </Typography>
                    <Typography variant="subtitle1" className="team-title">
                      {member.title}
                    </Typography>
                  </Box>
                </Box>
                <Box className="team-content">
                  <Typography variant="body2" className="team-introduction">
                    {member.introduction}
                  </Typography>
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* Staff Members Section */}
      <Container>
        <Typography variant="h3" component="h3" className="section-title">
          Our Dedicated Staff
        </Typography>
        <Grid container spacing={6} className="team-grid">
          {staffMembers.map((member, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <Paper className={`team-card ${index % 2 === 0 ? 'align-left' : 'align-right'}`}>
                <Box className="team-image-container">
                  <img src={member.image} alt={member.name} className="team-image" />
                  <Box className="team-overlay">
                    <Typography variant="h5" component="h3" className="team-name">
                      {member.name}
                    </Typography>
                    <Typography variant="subtitle1" className="team-title">
                      {member.title}
                    </Typography>
                  </Box>
                </Box>
                <Box className="team-content">
                  <Typography variant="body2" className="team-introduction">
                    {member.introduction}
                  </Typography>
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* Volunteers Section */}
      <Container>
        <Typography variant="h3" component="h3" className="section-title">
          Our Passionate Volunteers
        </Typography>
        <Grid container spacing={6} className="team-grid">
          {volunteers.map((member, index) => (
            <Grid item xs={12} sm={6} md={4} key={index}>
              <Paper className={`team-card ${index % 2 === 0 ? 'align-left' : 'align-right'}`}>
                <Box className="team-image-container">
                  <img src={member.image} alt={member.name} className="team-image" />
                  <Box className="team-overlay">
                    <Typography variant="h5" component="h3" className="team-name">
                      {member.name}
                    </Typography>
                    <Typography variant="subtitle1" className="team-title">
                      {member.title}
                    </Typography>
                  </Box>
                </Box>
                <Box className="team-content">
                  <Typography variant="body2" className="team-introduction">
                    {member.introduction}
                  </Typography>
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </div>
  );
};

export default About;
